import "./Home.css"
import blog from '../res/images/blog.png';


export default function Home(){
    return(
        <div id="home">
            <div id="Group-6">
                
                <h1>CampaignVault</h1>
                <h2>Uma ferramenta que promete te deixar rico</h2>
                
            </div>
            <div id="blog">
                <img alt="blog" id='blog' src={blog}/>
            </div>
        </div>
    )
}
